import { StyleSheet } from 'react-native';

export default styles = StyleSheet.create({
  container: {
    flex: 1,
    alignSelf: 'center',
    height: 128,
    width: 128,
    backgroundColor: '#E6E7E7',
    borderColor: 'red',
    borderWidth: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  icon: {
    height: 24,
    width: 24,
    color: '#757575'
  },
  text: {
    color: '#E6E7E7',
  },
});
